import { useParams } from 'react-router-dom'
import blogs from "../blog.json"

export default function Test() {
    const {id}=useParams();
    const blog=blogs.find(item=>toString(item.id)===id)
    return(
        <div>
            {blog.title}
            {id}
        </div>
    )
}
